import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-home',
  templateUrl: './home.page.html',
  styleUrls: ['./home.page.scss'],
})
export class HomePage implements OnInit {

  constructor() { }

  ngOnInit() {
  }

}
<ion-header [translucent]="true">
  <ion-toolbar color="primary">
    <ion-button slot="end" >Adicionar Cliente</ion-button>
    <ion-label style="padding: 5px; font-size: 18px; font-weight: bold;">Clientes</ion-label>
  </ion-toolbar>
</ion-header>

<ion-content [fullscreen]="true">
  <ion-list>

    <ion-item-sliding >
      <ion-item-options>
        <ion-item-option color="danger" >Deletar</ion-item-option>
        <ion-item-option color="success" >Atualizar</ion-item-option>
      </ion-item-options>
      <ion-item> {{c.nome}}</ion-item>
    </ion-item-sliding>

  </ion-list>
</ion-content>
